import React from 'react'

function Search({handleInput, search}) {
    return (
        <section className ="searchbox-wrap">
                <input
                 onChange ={handleInput} 
                 onKeypress={search}
                 type = "text"
                  placeholder="search movie" 
                  className ="searchbox"/>
        </section>
    )
}

export default Search
